actionConfiguration.body:
() => {
		var ret = []
		for (let i = 0; i < appsmith.store.GetStockOnHandOutput.length; i++){
			var materialCode = ""
			if (appsmith.store.GetStockOnHandOutput[i].material != null){
				materialCode = appsmith.store.GetStockOnHandOutput[i].material.code
			}
			var carrier = ""
			if (appsmith.store.GetStockOnHandOutput[i].carrier != null){
				carrier = appsmith.store.GetStockOnHandOutput[i].carrier.id
			}
			var status = ""
			if (appsmith.store.GetStockOnHandOutput[i].status != null){
				status = appsmith.store.GetStockOnHandOutput[i].status.code
			}
			var storageLocation = ""
			if (appsmith.store.GetStockOnHandOutput[i].storageLocation != null){
				storageLocation = appsmith.store.GetStockOnHandOutput[i].storageLocation.name
			}
			let line = {
				"Material":materialCode,
				"Carrier":carrier,
				"Status":status,
				"storageLocation":storageLocation,
				"Quantity":appsmith.store.GetStockOnHandOutput[i].quantity
			}
			ret.push(line)
		}
		return ret
	}

